Promotional info - &quot;Features Wolverine as a Canadian secret service agent in his pre-X-Men days. &quot;

Amazon Customer Review - &quot;This was a 48-page &quot;prestige&quot; squarebound ad-less comic book that cost $6 when originally issued in 1996. Logan teams up with (pre-super-powered) federal agent Carol Danvers (an old friend) to investigate the murder of a Canadian secret agent and the trail leads to....Sabertooth. The artwork gets the job done, though it is rather unattractive, and it's the Wolverine-Danvers team-up that is the main attraction of this story. If you haven't read it and can find it as a good price and you like our two main characters, you should enjoy it, even if only as a curiosity.&quot; - Daneel Olivaw 

